import React from "react";
import {ListInfo} from "./Styled";


const ListItem = ({ repo }) => {
  return (
    <ListInfo >
      <div >
        <a
          href={repo.url}
          target="_blank" 
        >
          {repo.name}
        </a> 
        <p> {repo.description}</p>
        <p>last updated</p>
      </div>

    </ListInfo>
  );
};

export default ListItem;
